    return(
    <div>
        <ol>
            <li> Sa {marca},{modelo}</li>
            <li>{marca},{modelo}</li>
            <li>{marca},{modelo}</li>
            <li>{marca},{modelo}</li>
        </ol>
    </div>
    
)
}

